    str += "source-descriptions-source-name = 1*(ALPHA / DIGIT / \"_\" / \"-\")\n";
    str += "source-descriptions-reference   = 1*CHAR\n";
    str += "\n";
    str += "; Secondary grammar for parsing $components name part\n";
    str += "; Format: {field}.{subField}\n";
